import {GET_PODCAST} from './actionTypes';
import axios from 'axios';

export const fetchPodcasts = () => dispatch => {

  console.log("sdafsdf")
  const podcast = axios.get('/podcast');

  // podcast.catch(e => {
  //   return console.log("dsfds")
  // });


dispatch({
  type: GET_PODCAST,
  payload: podcast
});
};
